import React from 'react';
import Homepage from "./pages/Homepage";
import './App.css';
import JuiceBody from "./components/JuiceBody";
import { Router } from "@reach/router";

function App() {
  return (
    <div className="App">
        <Router>
          <Homepage />
          <JuiceBody />
        </Router>
    </div>
  );
}

export default App;
